import React from "react";
const jsonData = require("../babyNamesData.json");
const ChildList = () => {
  return (
    <div>
      
      {jsonData.forEach((child) => (
        <div className="ChildList">{child.name} </div>
      ))}
    </div>
  );
};

export default ChildList;
